            <div className='col'>
              <img src={Home} className='position-absolute top-50 start-50' alt='home' />
              {quizBank.map((index, key) => {
                return (
                  <ul key={key}>
                    {index.ABOUT_YOU && index.ABOUT_YOU.map((question, j) => {
                      return (
                        <li key={j}>
                          {question.question}
                          {question.options.map((answers, key) => {
                            return (
                              <ul key={key}>
                                <li>{answers.label}</li></ul>
                            )

                          })}
                        </li>
                      )
                    })}

                    {index.YOUR_HOME && index.YOUR_HOME.map((your_home, p) => {
